import React from 'react';
import { Link } from 'react-router-dom'; // Import the Link component

const Allyoucanfly = () => {
  return (
    <div className="bg-white text-gray-900">

      {/* Hero Section */}
      <section className="bg-gradient-to-br from-sky-500 to-blue-700 text-white py-20 text-center px-4">
        <h1 className="text-5xl font-bold mb-4">All You Can Fly</h1>
        <p className="text-xl max-w-2xl mx-auto">
          Travel unlimited for one low price. Explore our premium membership for unlimited flights, exclusive offers, and more.
        </p>
      </section>

      {/* Membership Section */}
      <div className="text-center py-16">
        <h2 className="text-3xl font-semibold mb-4">Get Unlimited Flights</h2>
        <p className="text-lg text-gray-700 mb-6">
          Become a member today and unlock access to unlimited flights across all destinations.
        </p>
        
        {/* Button for Become a Member */}
        <Link to="/membership-registration">
          <button className="bg-sky-600 text-white font-semibold py-3 px-6 rounded-full hover:bg-sky-700 transition">
            Become a Member
          </button>
        </Link>
        
        <p className="mt-6 text-gray-600">Or</p>

        {/* Button for Join Now */}
        <Link to="/membership-registration">
          <button className="bg-green-600 text-white font-semibold py-3 px-6 rounded-full hover:bg-green-700 transition mt-4">
            Join Now
          </button>
        </Link>
      </div>
      
    </div>
  );
};

export default Allyoucanfly;
